import React from "react";
import periodicTables from "./periodicTables.png";
import weLoveMovies from "./weLoveMovies.png";

function Projects() {
  return (
    <div className="breathe">
      <h2 id="projects">My Babies</h2>
      <div className="row">
        <div className="column2">
          <div className="polaroid">
            <img
              style={{ width: "100%", borderRadius: "5px", maxHeight: "250px" }}
              src={periodicTables}
            />
            <div className="container">
              <p>GitHub Repo</p>
            </div>
          </div>
        </div>
        <div className="column2">
          <div className="polaroid">
            <img
              style={{ width: "100%", borderRadius: "5px", maxHeight: "250px" }}
              src={weLoveMovies}
            />
            <div className="container">
              <p>GitHub Repo</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Projects;

